import React, { Component } from 'react'

class ShowKlassContainer extends Component {

  render(){
    const klass = this.props.klasses.find(klass => klass.id == this.props.match.params.id) || ""
    return (
      <div>
        <h1>{klass.name}</h1>
      </div>
    )
  }
}

export default ShowKlassContainer
